import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';

class Login extends Component {

    render() {
      return (
        <body>
            <div className='login-area'>
                LOGIN
            </div>
        <div className="main-login">
        <div className ="main2-login">
      <Form.Group>
        <Form.Control type="username" name='username' placeholder='Username/Email' onChange={this.onChange} required />
      </Form.Group>
      
      <Form.Group>
        <Form.Control type="password" name='password' placeholder='Password' onChange={this.onChange} required />
      </Form.Group>
        <Button className="login-button" variant="primary" type="submit" >
          LOGIN
        </Button>
        <Button variant="link">Forgot password ?</Button>
      </div>
      </div>
      </body>

      );
    }
  }
  
  export default Login;
